  true,\n\t\"url\": null,\n\t\"notes\": \"The Capacity Management Database (CMD) is
  designed to track computer resource usage of the computer hardware running Veterans
  Health Information Systems and Technology Architecture (VistA). Information derived
  from CMD is used to assess the impact of planned new software products, identify
  the ramifications of archiving and purging of existing data, recognize emerging
  problems through database analysis, and validate sizing model expectations. Data
  for CMD is captured from all VistA systems in real time. Accumulated data is processed
  at each site and the results are transmitted to CMD using MailMan messages. Data
  can be added to CMD daily, along with the monthly updates. On a monthly basis, reports
  are sent to the Chief Information Officers (CIOs) of the Veterans Integrated Service
  Networks (VISNs) and Veterans Affairs Medical Center (VAMC) CIOs to allow review
  of the system's performance and identify future problems (e.g., lack of available
  disk space). IT personnel can access the database through the VA's intranet (http://vaww.oed.portal.va.gov/engineering/testing/CP/default.aspx)
  for comparison of their system with other sites. The users of CMD include the VA
  Office of Information & Technology, VISN CIOs, and facility CIO staff.\",\n\t\"license_title\":
